const RobotoSlab100 = `@font-face { font-family: 'Roboto Slab'; font-style: normal; font-weight: 100; src: local('Roboto Slab Thin'), local('RobotoSlab-Thin'), url('data:font/woff2;base64,') format('woff2'); }`;
